             <Button label="Submit" primary={true} style={style} onClick={(event) => this.handleClick(event)}>
             Zaloguj SiÄ™ </Button>
         </div>
         </MuiThemeProvider>
      </div>
    );
}

const style = {
 margin: 15,
};
export default Login;
